import React, { useState, useEffect } from "react";
import { Link, useHistory } from "react-router-dom";
import "./styles.css";
import api from "../../services/api";

import logoCadastro from "../../assets/contract.png";
import { FiUser, FiXCircle, FiEdit } from "react-icons/fi";

export default function Alunos() {
  const [nome, setNome] = useState("");
  const [alunos, setAlunos] = useState([]);

  const email = localStorage.getItem("email");
  const token = localStorage.getItem("token");

  const authorization = {
    headers: {
      Authorization: `Bearer ${token}`,
    },
  };

  useEffect(() => {
    api.get("api/alunos", authorization).then(
response);
  });

  return (
    <div className="aluno-container">
      <header>
        <img src={logoCadastro} alt="Cadastro" />
        <span>
          Bem-Vindo, <strong>Aluno</strong>!
        </span>
        <Link className="button" to="/aluno/novo/0">
          Novo Aluno
        </Link>
        <button type="button">
          <FiXCircle size={35} color="#17202a" />
        </button>
      </header>
      <form>
        <input type="text" placeholder="Nome" />
        <button type="button" className="button">
          Filtrar aluno por nome.
        </button>
      </form>
      <h1>Relação de Alunos.</h1>
      <ul>
        <li>
          <b>Nome:</b>Paulo
          <br />
          <br />
          <b>Email:</b>paulo@gmail.com
          <br />
          <br />
          <b>Idade:</b>22
          <br />
          <br />
          <button type="button">
            <FiEdit size="25" color="#17202a" />
          </button>
          <button type="button">
            <FiUser size="25" color="#17202a" />
          </button>
        </li>

        <li>
          <b>Nome:</b>Paulo
          <br />
          <br />
          <b>Email:</b>paulo@gmail.com
          <br />
          <br />
          <b>Idade:</b>22
          <br />
          <br />
          <button type="button">
            <FiEdit size="25" color="#17202a" />
          </button>
          <button type="button">
            <FiUser size="25" color="#17202a" />
          </button>
        </li>
      </ul>
    </div>
  );
}
